import { useRef } from "react";
import { Component, GlobalStyle, memo ,React, useStore} from "../importAll"


//basic
const Div  = new Component("",(props:IGlobalProps)=>{
    if(!props.Empty)
        return(
            <div 
                className={props.className} 
                style={GlobalStyle(props)} 
                key = {props.myKey}
                onClick={props.onClick}
            >
                {props.children}
            </div>
        ) 
        return <>{props.children}</>; 
}).GetOpenClose();

const Img  = new Component("",(props:IGlobalProps)=><img src={props.bgImg} style={GlobalStyle(props,{width:"100%",height:"auto"})} />).Get()

const Button = new Component("",(props:IButtonProps)=>{
    let {dispatch,actions} = useStore();
    function GoPage(event:any){
        if(props.toPage)    dispatch(actions.setMainPage(props.toPage))
        if(props.toSubPage) dispatch(actions.setSubPage(props.toSubPage))
        if(props.onClick)   props.onClick(event)
    }
    return <Div Flex border pointer XYcenter onClick={(x:any)=>GoPage(x)} {...props}> {props.value ||""} </Div>
}).Get();

const Grid       = new Component("", (props:IGlobalProps) => <Div Grid                  {...props}> {props.children}                     </Div>  ).Get();
const Container  = new Component("", (props:IGlobalProps) => <Grid                      {...props}> {props.children}                     </Grid> ).Get();
const Main       = new Component("", (props:IGlobalProps) => <Grid                      {...props}> {props.children}                     </Grid> ).Get();
const Footer     = new Component("", (props:IGlobalProps) => <Grid                      {...props}> {props.children}                     </Grid> ).Get();
const Nav        = new Component("", (props:IGlobalProps) => <Div                       {...props}> {props.children}                     </Div>  ).Get();
const Header     = new Component("", (props:IGlobalProps) => <Div                       {...props}> {props.children}                     </Div>  ).Get();
const Aside      = new Component("", (props:IGlobalProps) => <Div                       {...props}> {props.children}                     </Div>  ).Get();
const Box        = new Component("", (props:IGlobalProps) => <Div                       {...props}> {props.children}                     </Div>  ).Get();
const Icon       = new Component("", (props:IGlobalProps) => <Div                       {...props}> {props.children}                     </Div>  ).Get();
const Lable      = new Component("", (props:IGlobalProps) => <Div Flex XYcenter         {...props}> {props.children}                     </Div>  ).Get();
const Name       = new Component("", (props:IGlobalProps) => <Div Flex XYcenter         {...props}> {props.children}                     </Div>  ).Get();
const Flex       = new Component("", (props:IGlobalProps) => <Div Flex                  {...props}> {props.children}                     </Div>  ).Get();
const Copyright  = new Component("", (props:IGlobalProps) => <Div Flex XYcenter         {...props}> {props.value ||"כל הזכויות שמורות"} </Div>  ).Get();
const Menu       = new Component("", (props:IMenuProps  ) => <Flex spaceAround XYcenter {...props}> {props.children}</Flex>).Get();
const Choice     = new Component("", (props:IChiceProps ) => <Button  width={"100px"} height={"70%"} styleOverrid={props.selected?props.onSelectedStyle:null} {...props}>{props.value}</Button>).Get()
const Logo       = new Component("", (props:IGlobalProps) => <Img {...props} />).Get();

const Input  = memo( React.forwardRef( (props:IInputProps,ref:any) =>{
    return(
        <Flex {...props}>
            <Lable height="max-content">{props.value}</Lable>
            <input style={{height: "max-content"}} type={props.type} name={props.name} ref={ref} onChange={props.onChange}/>
            <span className="validation">{props.validMgs}</span>
        </Flex>
    )
}))

interface IButtonProps extends IGlobalProps{
    toPage    ?: AllMainPagesType;
    toSubPage ?: AllSubPagesType;
}

interface IMenuProps extends IGlobalProps{
    onSelected?:React.CSSProperties;
}
interface IChiceProps extends IButtonProps{
    onSelectedStyle?:React.CSSProperties;
    selected? : boolean;
}



interface IInputProps extends IGlobalProps{
    type:string;
    name?:string;
    ref:any;
    validMgs?:any;
}


export {Div}
export {Img}
export {Grid      }
export {Container }
export {Main      }
export {Footer    }
export {Nav       }
export {Header    }
export {Aside     }
export {Box       }
export {Icon      }
export {Lable     }
export {Name      }
export {Flex      }
export {Copyright }
export {Menu      }
export {Choice    }
export {Logo      }
export {Button      }
export {Input}
